function fadeOutVideo(isrc, speed) {
	if(!videofading && currentvideo !== "" || null || isrc) {
		videofading = true;
		var opa = 1;
		tf.style.opacity = opa;
		var x = setInterval(function() {
			if(opa >= 0) {
				tf.style.opacity = opa;
				opa-=0.01;
			} else {
				tf.style.visibility = "hidden";
				tf.src = "";
				clearInterval(x);
				videofading = false;
				tf.src = "";
				currentvideo = "";
				
			}
		}, speed);
	}
}
function fadeInVideo(isrc, speed, lop) {
	if(!videofading && isrc !== currentvideo) {
		currentvideo = isrc;
		videofading = true;
		var opa = 0;
		tf.style.opacity = opa;
		tf.src = "./videos/"+isrc;
		tf.style.visibility = "visible";
		tf.play();
		v = true;
		var x = setInterval(function() {
			if(opa <= 1) {
				tf.style.opacity = opa;
				opa+=0.01;
			} else {
				clearInterval(x);
				videofading = false;
				if(lop == "false") {
					tf.loop = false;
					tf.addEventListener('ended', function() {
						fadeOutVideo(isrc, 10);
						setTimeout(function() {
							textindex++;
							v = false;
							
							autoclick = true;
							document.getElementById('clickable').click();
							autoclick = false;
						}, 2000);
					});
				} else {
					v = false;
					
					tf.loop = true;
				}
			}
		}, speed);
	}
}
