function playSFX(fname, base) {
	for(var i = 0; i < sfxels.length; i++) {
		if(!sfxels[i][1]) {
			if(!base) {
				sfxels[i][0].src = "./sfx/"+fname+".wav";
			} else {
				sfxels[i][0].src = fname;
			}
			sfxels[i][0].play();
			sfxels[i][1] = true;
			sfxels[i][0].addEventListener('ended', function() {
				sfxels[i][1] = false;
			});
			break;
		} else {
			console.warn("Sound effect slot "+i+" is already in use.");
		}
	}
}
function Music(frag, lop) {
	if(currentsong !== frag) {
		currentsong = frag;
		if(!music[0][1]) {
			music[0][1] = true;
			music[0][0].src = "./music/"+currentsong+".mp3";
			music[0][0].play();
			var volumeA = 0;
			var volumeB = 1;
			var x = setInterval(function() {
				if(volumeA >= 1 ) {
					clearInterval(x);
				} else {
					volumeA += 0.01;
					music[0][0].volume = volumeA;
				}
			}, 1);
			var y = setInterval(function() {
				if(volumeB <= 0) {
					clearInterval(y);
					music[1][1] = false;
				} else {
					volumeB -= 0.01;
					music[1][0].volume = volumeB;
				}
			}, 1);
			if(lop == "true") {
				music[0][0].loop = true;
			} else {
				music[0][0].loop = false;
				playing = true;
				music[0][0].addEventListener('ended', function() {
					playing = false;
				});
			}
		} else if(!music[1][1]) {
			music[1][1] = true;
			music[1][0].src = "./music/"+currentsong+".mp3";
			music[1][0].play()
			var volumeA = 0;
			var volumeB = 1;
			var x = setInterval(function() {
				if(volumeA >= 1) {
					clearInterval(x);
				} else {
					volumeA += 0.01;
					music[1][0].volume = volumeA;
				}
			}, 1);
			var y = setInterval(function() {
				if(volumeB <= 0) {
					clearInterval(y);
					music[0][1] = false;
				} else {
					volumeB -= 0.01;
					music[0][0].volume = volumeB;
				}
			}, 1);
			if(lop == "true") {
				music[1][0].loop = true;
			} else {
				music[1][0].loop = false;
				playing = true;
				music[1][0].addEventListener('ended', function() {
					playing = false;
				});
			}
		}
	}
}
function delTitle(speed) {
	if(wrapper.innerHTML !== "" || null) {
		if(!fading) {
			fading = true;
			var opaci = 1;
			wrapper.style.opacity = opaci;
			var x = setInterval(function() {
				if(opaci <= 0) {
					fading = false;
					clearInterval(x);
					
					wrapper.innerHTML = "";
				} else {
					wrapper.style.opacity = opaci;
					opaci-=0.01;
				}
			}, speed);
		}
	}
}
function showTitle(txt, speed) {
	if(wrapper.innerHTML == "" || null) {
		if(!fading) {
			fading = true;
			var opaci = 0;
			wrapper.style.opacity = opaci;
			wrapper.innerHTML = txt;
			var x = setInterval(function() {
				if(opaci >= 1) {
					fading = false;
					clearInterval(x);
					
				} else {
					wrapper.style.opacity = opaci;
					opaci+=0.01;
				}
			}, speed);
		}
	}
}
function typeWriter(mtxt, speed) {
		if(!error && !typing) {
			var ttxt;
			if(mtxt.indexOf("") > 0) {
				var splstr = mtxt.split('');
				for(var i = 0; i < variables.length; i++) {
					if(variables[i] == splstr[1]) {
						splstr[1] = variables[i+1];
						break;
					}
				}
				ttxt = splstr.join('');
			} else {
				ttxt = mtxt;
			}
			voicing = true;
			txt_el.innerHTML = "";
			typing = true;
			var index = 0;
			var x = setInterval(function() {
				if(index > ttxt.length) {
					clearInterval(x);
					voicing = false;
					typing = false;
				} else {
					txt_el.innerHTML += ttxt.charAt(index);
					index++;
				}
			}, speed);
			if(voice !== "" || undefined) {
				voice_el.src = voice[Math.floor(Math.random() * voice.length)];
				voice_el.play();
				vended = true;
				voice_el.addEventListener('ended', function() {
					if(voicing) {
						vended = false;
						voice_el.src = voice[Math.floor(Math.random() * voice.length)];
						voice_el.play();
						vended = true;
					}
				});
			}
		}
}
function sleep(ms) {
	return new Promise(resolve => setTimeout(resolve, ms));
}
function optionEvent(evt, params) {
	document.getElementById('clickable').style.display = null;
	document.getElementById('message').style.visibility = "hidden";
	var splparams = params.split('$');
	if(evt == "skip") {
			parseText("<voice:"+splparams[0]+"><text:"+splparams[1]+":"+splparams[2]+">");
			textindex += splparams[3];
			prompting = false;
			events = [];
	} else if(evt == "continue") {
		textindex++;
		prompting = false;
		autoclick = true;
		document.getElementById('clickable').click();
		autoclick = false;
		events = [];
	} else if(evt == "confirm") {
		setTimeout(function() {
			textindex -= splparams[0];
			prompting = false;
			autoclick = true;
			document.getElementById('clickable').click();
			autoclick = false;
			events = [];
		}, 500);
	} else if(evt == "stop") {
		parseText("<voice:"+splparams[0]+"><text:"+splparams[1]+":"+splparams[2]+">");
		events = [];
		setTimeout(function() {
			window.close();
		}, 10000);
	}
}
