function parseInstructions(cmd) {
	if(cmd[0] !== "delay") {
			 if(cmd[0] == "sfx") {
					playSFX(cmd[1], false);
				} else if(cmd[0] == "music") {
					if(cmd[1] == "none" ){
						music[0][0].pause();
						music[1][0].pause();
					} else {
						Music(cmd[1], cmd[2]);
					}
				} else if(cmd[0] == "txtcolor") {
					txt_el.style.color = cmd[1];
					wrapper.style.color = cmd[1];
				} else if(cmd[0] == "image") {
					imageprops.srcr = cmd[1];
					imageprops.elea = cmd[2];
					imageprops.sp = cmd[3];
					if(imageprops.elea == "bkg") {
						if(imageprops.srcr == "nobkg") {
							fadeOutBackground(imageprops.srcr, imageprops.sp);
						} else {
							fadeOutBackground(imageprops.srcr, 1);
							setTimeout(function() {
								fadeInBackground(imageprops.srcr, imageprops.sp);
							}, (imageprops.sp / 0.01));
						}
					} else if(imageprops.elea == "fog") {
						if(imageprops.srcr == "nofog") {
							fadeOutForeground(imageprops.srcr, imageprops.sp);
						} else {
							fadeOutForeground(imageprops.srcr, 1);
							setTimeout(function() {
								fadeInForeground(imageprops.srcr, imageprops.sp);
							}, (imageprops.sp / 0.01));
						}
					}
				} else if(cmd[0] == "voice") {
					console.log("voice: '"+cmd[1]+"'");
					if(cmd[1] == null || "") {
						error = true;
						var emsg = "Variable error: person not defined.";
						console.error(emsg);
						music[0][0].pause();
						music[1][0].pause();
					} else {
						if(cmd[1] == "buna") {
							console.log("voice changed to: '"+cmd[1]+"'");
							voice = voiceindex.buna;
						} else if(cmd[1] == "pieter") {
							console.log("voice changed to: '"+cmd[1]+"'");
							voice = voiceindex.pieter;
						} else if(cmd[1] == "none") {
							voice = "";
						} else {
							error = true;
							var emsg = "Variable error: person not recognized: "+cmd[1];
							console.error(emsg);
							music[0][0].pause();
							music[1][0].pause();
						}
					}
				} else if(cmd[0] == "options") {
					prompting = true;
					playSFX("prompt");
					events.push(cmd[4], cmd[5], cmd[6], cmd[7]);
					document.getElementById('clickable').style.display = "block";
					document.getElementById('message').style.visibility = "visible";
					document.getElementById('msgtxt').innerHTML = cmd[1];
					document.getElementById('b0').innerHTML = cmd[2];
					document.getElementById('b1').innerHTML = cmd[3];
				} else if(cmd[0] == "input") {
					prompting = true;
					playSFX(baseSFX.s_prompt, true);
					document.getElementById('clickable').style.display = "block";
					keyboard.style.visibility = "visible";
					document.getElementById('question').innerHTML = cmd[2];
					var test = variables.join('|');
					if(test.indexOf(cmd[1]) == -1) {
						variables.push(cmd[1]);
					}
					currentname = cmd[1];
				} else if(cmd[0] == "video") {
					vidprops.srcr = cmd[1];
					vidprops.sp = cmd[2];
					vidprops.elea = cmd[3];
					if(vidprops.srcr == "none") {
						fadeOutVideo(vidprops.srcr, vidprops.sp);
					} else if(!v) {
						setTimeout(function() {
							fadeInVideo(vidprops.srcr, vidprops.sp, vidprops.elea);
						}, ( vidprops.sp / 0.01));
					}
				} else if(cmd[0] == "title") {
					titling = true;
					txt_el.innerHTML = "";
					if(cmd[1] == "none") {
						delTitle(5);
					} else {
						showTitle(cmd[1], 10);
						setTimeout(function() {
							delTitle(5);
							setTimeout(function() {
								titling = false;
								autoclick = true;
								document.getElementById('clickable').click();
								autoclick = false;
							}, 2000);
						}, cmd[2]);
					}
				} else if(cmd[0] == "speed") {
					speed = cmd[1];
				} else if(cmd[0] == "autotype") {
					if(cmd[1] == "false") {
						autotype = false;
					} else {
						autotype = true;
					}
				} else if(cmd[0] == "autoclick") {
					setTimeout(function() {
						autoclick = true;
						document.getElementById('clickable').click();
						autoclick = false;
					}, cmd[1]);
				}
			}
	}
async function parseText(txts) {
	if(txts.indexOf("") > -1) {
		var seperatedtext = txts.split("");
		var innerIndex = seperatedtext.length;
		var currentInnerIndex = 0;
		for(var i = 0; i < seperatedtext.length; i++) {
			currentInnerIndex = i;
			if(seperatedtext[i].indexOf("<") > -1 && seperatedtext[i].indexOf(">") > -1) {
				if(!error) {
					var seperated = seperatedtext[i].split("<").join("").split(">");
					for(var j = 0; j < seperated.length; j++) {
						if(seperated[j] !== "" || null || undefined) {
							if(seperated[j].indexOf(":") > -1) {
								var cmd = seperated[j].split(":");
								if(cmd[0] == "delay") {
									sleeping = true;
									await sleep(cmd[1]);
									sleeping = false;
								}
								parseInstructions(cmd);
							} else {
								parseInstructions(seperated[j]);
							}
						}
					}
				} else {
					break;
				}
			} else {
				if(!error) {
					var ctext = seperatedtext[i];
					if(autotype) {
						typeWriter(ctext, speed);
					} else {
						txt_el.innerHTML = ctext;	
					}
				} else {
					break;
				}
			}
		}
	} else {
		if(!error) {
			var ctext = txts;
			if(autotype) {
			typeWriter(ctext, speed);
			} else {
				txt_el.innerHTML = ctext;	
			}
		}
	}
}
