function setCursor() {
	if(!error && !playing && !typing && !intro && !ending && !v && !prompting && !titling && !autoclick) {
		document.getElementById('clickable').style.cursor = "pointer";
	} else {
		document.getElementById('clickable').style.cursor = "context-menu";
	}
}
file_el.addEventListener('change', function() {
	loadFileAsText(file_el.files[0]);
	textindex = 0;
});
document.getElementById('clickable').addEventListener('mouseover', setCursor());
document.getElementById('clickable').addEventListener('click', function() {
	if(file_el.files.length == 0) {
		file_el.click();
	} else {
		if(firstpress) {
		playSFX(baseSFX.s_titlescreen, true);
		txt_el.innerHTML = "";
		firstpress = false;
		}
		if(!error && !sleeping && !playing && !typing && textindex > 0 && !forimagefading && !bkgimagefading && !intro && !ending && !v && !prompting && !titling && !autoclick) {
			playSFX(baseSFX.s_button, true);
		}
		if(!intro && !sleeping && !voicing && !v && !declined && !titling && !forimagefading && !bkgimagefading && !playing && !typing && !prompting && !error && textindex < txt.length) {
			parseText(txt[textindex]);
			textindex++;
		} else if (textindex >= txt.length) {
			window.close();
		}
	}
});